from sage.all import *
from sage.matrix.matrix2 import Matrix as Matrix2
from Crypto.Util.number import *




def resultant(f1, f2, var):
    return Matrix2.determinant(f1.sylvester_matrix(f2, var))
PR=PolynomialRing(Zmod(p),names=['a','b','c'])
a,b,c=PR.gens()
f1=a**2*b+b*c+c**6-c1
f2=a**2+3*b*c+c**4-c2
f3=a*b+b**4+a*c-c3
h1=resultant(f1,f2,c)
h2=resultant(f2,f3,c)
h12=resultant(h1,h2,b)
res=h12.univariate_polynomial().roots()
print(long_to_bytes(int(res[-1][0])))
